import swal from "sweetalert";
import axios from "axios";
import { useState,useEffect }  from "react";
import { useNavigate, useParams} from "react-router-dom";
const URI = "http://localhost:8080/prestamo/"


//sessionStorage.setItem("usuario",
//sessionStorage.setItem("clave",123456);
let headers = {
    "usuario" : sessionStorage.getItem("usuario"),
    "clave"   : sessionStorage.getItem("clave")
  };

const MostrarPrestamo = () => {
    const navigate = useNavigate();
    const [prestamos, setPrestamos] = useState([])
    useEffect(() =>{
        getPrestamos()
    })
    const {id} = useParams()
    const getPrestamos = async () =>{
        
        const res = await axios({
            method : "GET",
            url : URI + "consulta_prestamo?idc="+id,
            headers: headers
           
        });
        
        setPrestamos(res.data)     
            
        
    }

     
return(
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    <table className='table'>
                        <thead className='table-primary'>
                            <tr>
                                <th>Id</th>
                                <th>Id cuenta</th>
                                <th>Id cuenta</th>
                                <th>Fecha solicitud</th>
                                <th>Saldo solicitado</th>
                                <th>N. Cuotas</th>
                                <th>valor cuota</th>
                                <th>Saldo Pendiente</th>
                            </tr>
                        </thead>
                        <tbody>
                            { prestamos.map ( (prestamo) => (
                                <tr key={ prestamo.id_prestamo}>
                                    <td> { prestamo.id_prestamo } </td>
                                    <td> {prestamo.id_cuenta}</td>
                                    <td> { prestamo.fecha_solicitud } </td>
                                    <td> { prestamo.saldo_solicitado } </td>
                                    <td> { prestamo.n_cuotas } </td>
                                    <td> { prestamo.valor_cuota } </td>
                                    <td> { prestamo.saldo_pendiente } </td>
   
                                </tr>
                            )) }
                        </tbody>
                    </table>
                </div>    
            </div>
        </div>
    );
};

export default MostrarPrestamo;
